import React from "react";
import "./Cars.css";
import { BiGasPump } from "react-icons/bi";
import { GiElectric } from "react-icons/gi";
import { BsSpeedometer2 } from "react-icons/bs";

function CarsHolder(props) {
  return (
    <div className="CarsHolder">
      <div className="CarsHolder-img">
        <img src={props.item.carUrl} alt="img" />
      </div>
      <div className="CarHolder-details">
        <div className="car-name">
          <div className="model">
            <h5>{props.item.model}</h5>
          </div>
          <div className="year">
            <p>{props.item.year}</p>
          </div>
        </div>
        <div className="car-more-details">
          <div>
            <small>
              {props.item.type === "Gasoline" ? <BiGasPump /> : <GiElectric />}{" "}
              {props.item.type}
            </small>
          </div>
          <div>
            <small>
              <BsSpeedometer2 /> {props.item.speed}
            </small>
          </div>
          <div>
            <small>{props.item.gear}</small>
          </div>

          <div>
            <small>{props.item.people}</small>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CarsHolder;
